import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Chess from "./components/Chess";

function App() {
    return (
        <>
            <Router>
                <Routes>
                    <Route exact path="/">
                        <Redirect to="/home" />
                    </Route>
                    <Route path="/home" exact element={<Chess />} />
                </Routes>
            </Router>
        </>
    );
}

export default App;
